(1, 'BIENVENIDO AL PORTAL DEL SIG DE LA UNIVERSIDAD POLITÉCNICA DE TECÁMAC, EN ESTE LUGAR ENCONTRARÁS LOS DOCUMENTOS QUE INTEGRAN NUESTRO SISTEMA INTEGRAL DE GESTIÓN BASADO EN LAS NORMAS NMX-CC-9001-IMNC-2015 (ISO 9001:2015) Y NMX-SAA-14001-IMNC-2015 (ISO 14001:2015), TE INVITAMOS A QUE CONSULTES NUESTRA POLÍTICA DE CALIDAD Y GESTIÓN AMBIENTAL, PROCEDIMIENTOS, FORMATOS Y DEMÁS DOCUMENTOS QUE FORMAN PARTE DE TU PROCESO, ¡ÚNETE A LA CALIDAD Y A LA GESTIÓN AMBIENTAL! ', '“BRINDAR SERVICIOS EDUCATIVOS REFERENTES A LA INSCRIPCIÓN, REINSCRIPCIÓN Y EL PROCESO EDUCATIVO, CON UN ENFOQUE DE RESPETO AL MEDIO AMBIENTE Y USO RACIONAL DE LOS RECURSOS, A TRAVÉS DEL SISTEMA INTEGRAL DE GESTIÓN COMO HERRAMIENTA DE MEJORA CONTINUA Y EL COMPROMISO DE LA COMUNIDAD UNIVERSITARIA EN EL CUMPLIMIENTO DE LA LEGISLACIÓN AMBIENTAL APLICABLE.”', '“CONTRIBUIR AL CRECIMIENTO NACIONAL, MEDIANTE LA FORMACIÓN DE PROFESIONISTAS DE CALIDAD, A TRAVÉS DE COMPETENCIAS PROFESIONALES CON INNOVACIÓN EN LA GENERACIÓN DE TECNOLOGÍA; QUE PERMITA RESOLVER LA PROBLEMÁTICA DE LAS EMPRESAS, FOMENTAR EL BIENESTAR SOCIAL, AVIVAR LOS VALORES HUMANÍSTICOS Y LA CONSERVACIÓN DE LA CULTURA ECOLÓGICA.”', '“SER UN REFERENTE NACIONAL, CON RECONOCIMIENTO INTERNACIONAL EN EDUCACIÓN SUPERIOR BASADA EN COMPETENCIAS PROFESIONALES CON PROGRAMAS EDUCATIVOS DE CALIDAD QUE FORMEN TÉCNICA, ÉTICA Y PROFESIONALMENTE A SUS EGRESADOS PARA LA INVESTIGACIÓN, EL DESARROLLO TECNOLÓGICO, LA PREVENCIÓN DEL MEDIO AMBIENTE, LA PROMOCIÓN DE LA CULTURA Y EL APORTE AL DESARROLLO ECONÓMICO Y SOCIAL, EN APEGO AL COMPROMISO DE MEJORA CONTINUA Y AL CUMPLIMIENTO DEL PLAN DE DESARROLLO INSTITUCIONAL EN EL AÑO 2023.”', '2020-12-14 22:37:20', '0000-00-00 00:00:00');
